import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div className="App">

        <div class="navbar">
          <a class="navbar-brand" href="#">Title</a>
          <ul class="nav navbar-nav">
            <li class="active">
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">Link</a>
            </li>
          </ul>
        </div>

    </div>
    );
  }
}

export default App;
